import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { classRoom } from './_models/entityModels';
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title = "Developer's ClassRoom";
  classRoom : classRoom[] | any;

  constructor(private http: HttpClient) {}

  ngOnInit(): void {
    this.http.get('https://localhost:7217/api/classRoom/').subscribe({
      next : response => {
        this.classRoom = response;
        console.log(response);
      },
      error: () => console.log(console.error()),
      complete: () => console.log('Requse has Been Completed')
    })
  }



}
